import RastaurantImage from "../component/Home/RastaurantImage";
import Slider from "../component/Home/Slider";
import Speciality from "../component/Home/Speciality";
const Home = () => {
  return (
    <>  
      <Slider />
      <Homeabout />
      <RastaurantImage />
      <Ourmenu />
      <Speciality />
      <Offer />
      <Tips />   

    </>
  );
}
export default Home;
